<script>
  import { ref, computed, onMounted, watch, nextTick } from 'vue'
  import { gsap } from 'gsap'
  import { MorphSVGPlugin } from 'gsap/MorphSVGPlugin'

  // Register GSAP plugin
  gsap.registerPlugin(MorphSVGPlugin)

  export default {
    name: 'CylinderBoxAnimation',
    props: {
      isHovered: {
        type: Boolean,
        default: false
      },
      isTouched: {
        type: Boolean,
        default: false
      },
      isMaximized: {
        type: Boolean,
        default: false
      },
      autoPlay: {
        type: Boolean,
        default: false
      }
    },
    setup(props) {
      console.log('👀 CylinderBoxAnimation.vue -> setup', { isMaximized: props.isMaximized });

      const svgRef = ref(null)
      const timeline = ref(null)

      const svgSize = computed(() => {
        if (props.isMaximized) {
          return { width: 600, height: 350 }
        }
        return { width: 300, height: 175 }
      })

      const createAnimation = () => {
        if (!svgRef.value) return

        console.log('👀 CylinderBoxAnimation.vue -> createAnimation', { creating: true });

        const tl = gsap.timeline({
          paused: true,
          onComplete: () => {
            console.log('👀 CylinderBoxAnimation.vue -> onComplete', { animationFinished: true });
          }
        })

        tl.to("#box .top-box-face", {
          morphSVG: "#cilinder .body",
          duration: 1,
          ease: "power2.inOut",
        });
        tl.to("#box .side-box-face", {
          morphSVG: "#cilinder .body",
          duration: 1,
          ease: "power2.inOut",
        }, "-=1");
        tl.to("#box .front-box-face", {
          morphSVG: "#cilinder .front-circle-face",
          duration: 1,
          ease: "power2.inOut",
        }, "-=1");

        tl.to("#box .dimensions .width", {
          morphSVG: "#cilinder .diameter",
          duration: 1,
          ease: "power2.inOut",
        }, "-=1");

        tl.to("#box .dimensions .length", {
          morphSVG: "#cilinder .dimensions .length",
          duration: 1,
          ease: "power2.inOut",
        }, "-=1");

        tl.to([
          "#box .dimensions .height",
          "#box .texts .height"
        ], {
          opacity: 0,
          duration: 0.5,
          ease: "power2.inOut",
        }, "-=1");

        tl.to("#box .texts .length", {
          morphSVG: "#cilinder .texts .length",
          duration: 1,
          ease: "power2.inOut",
        }, "-=1");
        tl.to("#box .texts .width", {
          morphSVG: "#cilinder .texts .diameter",
          duration: 1,
          ease: "power2.inOut",
        }, "-=1");

        tl.to("#box .texts .totalSum", {
          morphSVG: "#cilinder .texts .totalSum",
          duration: 1,
          ease: "power2.inOut",
        }, "-=1");

        timeline.value = tl
      }

      const playAnimation = () => {
        if (timeline.value) {
          console.log('👀 CylinderBoxAnimation.vue -> playAnimation', { playing: true });
          timeline.value.restart()
        }
      }

      const reverseAnimation = () => {
        if (timeline.value) {
          console.log('👀 CylinderBoxAnimation.vue -> reverseAnimation', { reversing: true });
          timeline.value.reverse()
        }
      }

      // Watch for hover/touch changes
      watch([() => props.isHovered, () => props.isTouched], ([hovered, touched]) => {
        console.log('👀 CylinderBoxAnimation.vue -> watch', { hovered, touched });
        if (hovered || touched) {
          playAnimation()
        } else if (!props.autoPlay) {
          reverseAnimation()
        }
      })

      // Auto play when maximized
      watch(() => props.autoPlay, (autoPlay) => {
        if (autoPlay) {
          playAnimation()
        }
      })

      onMounted(async () => {
        await nextTick()
        createAnimation()

        if (props.autoPlay) {
          playAnimation()
        }
      })

      return {
        svgRef,
        svgSize
      }
    }
  }
</script>

